// HasChannel applies the HasEdge predicate on the "channel" edge.
func HasChannel() predicate.ChannelPerformance {
	return predicate.ChannelPerformance(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2O, true, ChannelTable, ChannelColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasChannelWith applies the HasEdge predicate on the "channel" edge with a given conditions (other predicates).
func HasChannelWith(preds ...predicate.Channel) predicate.ChannelPerformance {
	return predicate.ChannelPerformance(func(s *sql.Selector) {
		step := newChannelStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.ChannelPerformance) predicate.ChannelPerformance {
	return predicate.ChannelPerformance(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.ChannelPerformance) predicate.ChannelPerformance {
	return predicate.ChannelPerformance(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.ChannelPerformance) predicate.ChannelPerformance {
	return predicate.ChannelPerformance(sql.NotPredicates(p))
}
